import React, { useEffect, useState } from 'react'
import Player from '../../models/Player';

function Home() {

    const [ player, setPlayer ] = useState(new Player());

    useEffect(() => {
        let p = new Player();
        setPlayer(p);
    }, [] )

    return (<>
        <span>{player.getNome()}</span>
        <br />
        <span>{player.getCor()}</span>
    </>)
}

export default Home;
